    geo_json_74abe6e6bb14d3fd1dd2ee09cc0f1f5a.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["osmid", "highway", "maxspeed", "name", "oneway", "reversed", "length", "stoplights", "steps", "surface", "speed_kph", "travel_time", "penalized_weight", "lanes", "bridge", "ref", "tunnel", "service", "width", "access"];
    let aliases = ["osmid", "highway", "maxspeed", "name", "oneway", "reversed", "length", "stoplights", "steps", "surface", "speed_kph", "travel_time", "penalized_weight", "lanes", "bridge", "ref", "tunnel", "service", "width", "access"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
    ,{
  "sticky": true,
